CREATE OR REPLACE VIEW `v_mineSamtaler` AS select `samtale`.`datetime` AS `tidspunkt`,`ringt`.`telefonnummer` AS `oppringtNummer`,concat(`ringt`.`fornavn`,' ',`ringt`.`etternavn`) AS `ringtNavn`,`r`.`displaytext` AS `resultat`,`samtale`.`kommentar` AS `kommentar`,`oppfoelging`.`id` AS `oppfoelgingId`,`ringerPerson`.`telefonnummer` AS `ringersTelefonnummer`,`ringerPerson`.`hypersysID` AS `hypersysID`,concat(`ringerPerson`.`fornavn`,' ',`ringerPerson`.`etternavn`) AS `ringerNavn`,`ringerPerson`.`lokallag` AS `lokallag`,`samtale`.`modus` AS `modus` from (((((`samtale` join `person` `ringt` on((`samtale`.`ringt` = `ringt`.`id`))) join `ringer` on((`ringer`.`id` = `samtale`.`ringer`))) join `person` `ringerPerson` on((`ringer`.`personId` = `ringerPerson`.`id`))) left join `oppfoelgingValg21` `oppfoelging` on((`oppfoelging`.`samtaleId` = `samtale`.`id`))) join `resultat` `r` on((`r`.`id` = `samtale`.`resultat`)));

CREATE OR REPLACE VIEW `v_personerSomKanRinges` AS select `p`.`lokallag` AS `lokallag`,`p`.`id` AS `id`,`p`.`hypersysID` AS `hypersysID`,`p`.`fylke` AS `fylke`,`p`.`groupID` AS `brukergruppe`,(select `samtale`.`datetime` from `samtale` where (`samtale`.`ringt` = `p`.`id`) order by `samtale`.`datetime` desc limit 1) AS `sisteSamtale` from (`person` `p` left join `lokallag` `l` on((`p`.`lokallag` = `l`.`id`))) where (`p`.`groupID` in (select `brukergruppe`.`id` from `brukergruppe` where ((`brukergruppe`.`navn` = 'klar til å ringes') or (`brukergruppe`.`navn` = 'prioritert å ringe'))) and ((unix_timestamp(now()) - coalesce((select unix_timestamp(max(`samtale`.`datetime`)) from `samtale` where (`samtale`.`ringt` = `p`.`id`)),0)) > 86400) and exists(select 1 from `oppslag` `o` where ((`o`.`ringt` = `p`.`id`) and ((unix_timestamp(now()) - unix_timestamp(`o`.`datetime`)) < 3600))) is false);

CREATE OR REPLACE VIEW `v_samtalerResultat` AS select distinct concat(`ringerPerson`.`fornavn`,' ',`ringerPerson`.`etternavn`) AS `ringerNavn`,`samtale`.`datetime` AS `datetime`,`samtale`.`kommentar` AS `kommentar`,`r`.`displaytext` AS `resultat`,concat(`ringt`.`fornavn`,' ',`ringt`.`etternavn`) AS `ringtNavn`,`ringt`.`telefonnummer` AS `oppringtNummer`,`oppfoelging`.`id` AS `oppfoelgingId` from (((((`samtale` join `person` `ringt` on((`ringt`.`id` = `samtale`.`ringt`))) join `resultat` `r` on((`r`.`id` = `samtale`.`resultat`))) join `ringer` on((`ringer`.`id` = `samtale`.`ringer`))) join `person` `ringerPerson` on((`ringerPerson`.`id` = `ringer`.`personId`))) left join `oppfoelgingValg21` `oppfoelging` on((`oppfoelging`.`samtaleId` = `samtale`.`id`))) where (`samtale`.`resultat` <> 9) order by `samtale`.`datetime`;

